import React from "react";
import "./Ourteam.css";
import { FaDatabase, FaCode, FaPaintBrush, FaProjectDiagram, FaLaptopCode } from "react-icons/fa";

const teamMembers = [
  { name: "Alice Johnson", role: "Project Leader", icon: <FaProjectDiagram size={50} /> },
  { name: "Bob Smith", role: "Backend Developer", icon: <FaDatabase size={50} /> },
  { name: "Charlie Brown", role: "Frontend Developer", icon: <FaLaptopCode size={50} /> },
  { name: "David Lee", role: "UI/UX Designer", icon: <FaPaintBrush size={50} /> },
  { name: "Emma Wilson", role: "Database Administrator", icon: <FaCode size={50} /> },
];

const OurTeam = () => {
  return (
    <div className="our-team-container">
      <h2>Our Team</h2>
      <div className="team-grid">
        {teamMembers.map((member, index) => (
          <div key={index} className="team-member">
            <div className="icon-container">{member.icon}</div>
            <h3>{member.name}</h3>
            <p>{member.role}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default OurTeam;
